import Slider from '../Components/Slider';
import SliderOne from '../Components/SliderOne';

const Homepage = () => {
  return (
    <>
      <div className="gallery-container">
        <header></header>
      </div>

      <div className="Slider">
        <h2>Fotos</h2>
        <Slider></Slider>
        <SliderOne></SliderOne>
      </div>
    </>
  );
};
export default Homepage;
